import React, { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";
import { getQueueItems, getServices, addQueueItems, deleteQueueItem } from "../services/api";
import "./QueueDetail.css";

const QueueDetail = () => {
    const { queue_id } = useParams();
    const navigate = useNavigate();
    const [queueItems, setQueueItems] = useState([]);
    const [services, setServices] = useState([]);
    const [selectedService, setSelectedService] = useState("");
    const [pairCount, setPairCount] = useState(1);

    useEffect(() => {
        fetchQueueItems();
        fetchServices();
    }, []);

    const fetchQueueItems = async () => {
        try {
            const res = await getQueueItems(queue_id);
            setQueueItems(res.data);
        } catch (error) {
            console.error("🔴 Error fetching queue items:", error);
        }
    };

    const fetchServices = async () => {
        try {
            const res = await getServices();
            setServices(res.data);
        } catch (error) {
            console.error("🔴 Error fetching services:", error);
        }
    };

    const handleAddService = async () => {
        if (!selectedService || pairCount < 1) {
            alert("กรุณาเลือกบริการและใส่จำนวนคู่รองเท้า");
            return;
        }

        const selectedServiceData = services.find(s => s.id == selectedService);
        if (!selectedServiceData) return;

        try {
            const newItem = {
                service_id: selectedService,
                pair_count: pairCount,
                price_per_pair: selectedServiceData.base_price
            };
            await addQueueItems(queue_id, [newItem]);
            fetchQueueItems();
            setSelectedService("");
            setPairCount(1);
        } catch (error) {
            console.error("🔴 Error adding queue item:", error);
        }
    };

    const handleDeleteService = async (item_id) => {
        if (!window.confirm("คุณต้องการลบบริการนี้ออกจากคิวหรือไม่?")) return;

        try {
            await deleteQueueItem(item_id);
            fetchQueueItems();
        } catch (error) {
            console.error("🔴 Error deleting queue item:", error);
        }
    };

    return (
        <div className="queue-detail-container">
            <h1>🏷️ รายละเอียดคิว #{queue_id}</h1>
            <button onClick={() => navigate('/queue')}>⬅️ กลับไปหน้าคิว</button>

            <h2>📋 รายการบริการ</h2>
            <table>
                <thead>
                    <tr>
                        <th>บริการ</th>
                        <th>จำนวนคู่</th>
                        <th>ราคา/คู่</th>
                        <th>ลบ</th>
                    </tr>
                </thead>
                <tbody>
                    {queueItems.map(item => (
                        <tr key={item.id}>
                            <td>{item.service_name}</td>
                            <td>{item.pair_count}</td>
                            <td>{item.price_per_pair} บาท</td>
                            <td><button onClick={() => handleDeleteService(item.id)}>❌</button></td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <h2>➕ เพิ่มบริการ</h2>
            <select value={selectedService} onChange={(e) => setSelectedService(e.target.value)}>
                <option value="">-- เลือกบริการ --</option>
                {services.map(service => (
                    <option key={service.id} value={service.id}>{service.service_name} ({service.base_price}  บาท/คู่)</option>
                ))}
            </select>
            <input type="number" min="1" value={pairCount} onChange={(e) => setPairCount(e.target.value)} />
            <button onClick={handleAddService}>เพิ่ม</button>
        </div>
    );
};

export default QueueDetail;
